import { NavigationContainer } from "@react-navigation/native";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { TransactionProvider } from "./context/TransactionContext";

// Screens
import HomeScreen from "./screens/HomeScreen";
import MoneyDiaryScreen from "./screens/MoneyDiaryScreen";
import AddIncome from "./screens/AddIncome";
import AddExpense from "./screens/AddExpense";
import Transactions from "./screens/Transactions";
import EditTransaction from "./screens/EditTransaction";

const Tab = createBottomTabNavigator();
const Stack = createNativeStackNavigator();

// ----------------------------
// Money Diary Stack Navigation
// ----------------------------
function DiaryStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="MoneyDiaryScreen"
        component={MoneyDiaryScreen}
        options={{ title: "Money Diary" }}
      />
      <Stack.Screen name="AddIncome" component={AddIncome} />
      <Stack.Screen name="AddExpense" component={AddExpense} />
      <Stack.Screen name="Transactions" component={Transactions} />
      <Stack.Screen name="EditTransaction" component={EditTransaction} />
    </Stack.Navigator>
  );
}

// ----------------------------
// Main App Tabs
// ----------------------------
function AppTabs() {
  return (
    <Tab.Navigator screenOptions={{ headerShown: false }}>
      <Tab.Screen name="Home" component={HomeScreen} />
      <Tab.Screen name="Diary" component={DiaryStack} />
    </Tab.Navigator>
  );
}

// ----------------------------
// MAIN APP
// ----------------------------
export default function App() {
  return (
    <TransactionProvider>
      <NavigationContainer>
        <AppTabs />
      </NavigationContainer>
    </TransactionProvider>
  );
}
